import React, { useEffect, useState } from 'react';
import axios from 'axios';
import BBCard from './BBCard';
import bb from '../assets/breaking-bad.jpeg';

export default function Series() {
    const [ BBList, setBBList ] = useState ([]);

    useEffect(() => {
        axios
            .get('https://tarea-1-breaking-bad.herokuapp.com/api/episodes?series=Breaking+Bad')
            .then(response => {
                console.log(response.data);
                setBBList(response.data);
            })
            .catch(err => {
                console.log(err)
            })
    }, [])

    var seasons = [];
    for (var key in BBList) {
        if (seasons.includes(parseInt(BBList[key].season))) {
            // pass
        } else {
            console.log(key, BBList[key])
            seasons.push(parseInt(BBList[key].season))
        } 
    }
    console.log(seasons[0]===seasons[1])

    console.log('Temporadas:')
    console.log(seasons);

    return(
        <section className='characters-list'>
            <h2>Breaking Bad</h2>
            <img src={bb} alt="imagen"></img>
            {seasons.map((value, id) => {
                return <BBCard value={value} id={id} />
            })}
        </section>
    )
}
